import React from 'react';

const SiteHeader = () => {
 return (
   <header>
     <div className="logo">
       <img src={require('C:/Users/fobus/Desktop/site/verstka/my-app/src/components/img/logo.png').default} alt="Логотип" />
     </div>
     <div className="search">
       <input type="text" placeholder="Поиск..." />
       <button><img src={require('./img/Search.png').default} alt="Иконка поиска" /></button>
     </div>
     <div className="icons">
       <a href="#"><img src={require('./img/gpoup.png').default} alt="Иконка 1" /></a>
       <a href="#"><img src={require('./img/Phone.png').default} alt="Иконка 2" /></a>
